import React, { Component } from 'react';
import AlcoholCalendar from '../components/AlcoholCalendar';
import axios from 'axios';

export class home extends Component {

    state = {
        account:null,
        drawerVisible:false,
        drawerContent:null
      };

updateData() {
    axios.get('http://localhost:3000/Account',{ withCredentials: true  })
    .then(res => {
    if(res) {

      const res_data = res.data;
      this.setState({ account: (res.data) })
      console.log(this.state.account)

    }

    }).catch((error) => {
        console.log(error); //Logs a string: Error: Request failed with status code 404
      //  window.location.href='/auth';

      });
}
componentDidMount() {
    this.updateData();

  }

  toggleDrawer(e){
      this.setState({drawerVisible:!this.state.drawerVisible});
  }

 setDrawerContent(c){
    this.setState({drawerContent:c});
}


  render() {
    return (<div>
      home
      <button onClick={e=>this.updateData()}></button>
      <div heigh='500px'>
      <AlcoholCalendar updateData={this.updateData.bind(this)} setDrawerContent={this.setDrawerContent.bind(this)} toggleDrawer={this.toggleDrawer.bind(this)} eating_data={(this.state.account ? this.state.account.activity_data.alcohol_data:{}) }
      />
      </div>
    </div>

    );
  }
}
export default home
